      <td colspan="3" bgcolor="#FFFFFF"><div align="left" style="margin: 0px; padding: 0px;"><font size="2">14W（30W相当）</font></div></td>
    </tr>
    <tr align="center" valign="middle" bgcolor="#FFFFFF">
      <td bgcolor="#FFFFFF"><div align="center" style="margin: 0px; padding: 0px;"><font size="2"><strong style="font-weight: 700; font-style: normal;">発光色</strong></font></div></td>
      <td colspan="3" bgcolor="#FFFFFF"><div align="left" style="margin: 0px; padding: 0px;"><font size="2">昼光色(6000K)</font></div></td>
