      <td bgcolor="#FFFFFF"><div align="center" style="margin: 0px; padding: 0px;"><font size="2"><strong style="font-weight: 700; font-style: normal;">サイズ(約)</strong></font></div></td>
      <td colspan="3" bgcolor="#FFFFFF"><div align="left" style="margin: 0px; padding: 0px;"><font size="2">外形&phi;225&times;管径&phi;30mm</font></div></td>
    </tr>
    <tr align="center" valign="middle" bgcolor="#FFFFFF">
