    </tr>
    <tr align="center" valign="middle" bgcolor="#FFFFFF">
      <td bgcolor="#FFFFFF"><div align="center" style="margin: 0px; padding: 0px;"><font size="2"><strong style="font-weight: 700; font-style: normal;">付属品</strong></font></div></td>
      <td colspan="3" bgcolor="#FFFFFF"><div align="left" style="margin: 0px; padding: 0px;"><font size="2">口金付きケーブル</font></div></td>
    </tr>
    <tr align="center" valign="middle" bgcolor="#FFFFFF">
      <td bgcolor="#FFFFFF"><div align="center" style="margin: 0px; padding: 0px;"><font size="2"><strong style="font-weight: 700; font-style: normal;">注意事項</strong></font></div></td>
      <td colspan="3" bgcolor="#FFFFFF"><div align="left" style="margin: 0px; padding: 0px;"><font size="2">グロー式の照明器具ならば、グロー球を取り外せばご使用頂けます。<br />
        ラピッド式、インバータ式の場合、工事が必要です。安定器を取外しAC電源と直結してください。<br>◆グロー式灯具でない灯具で、グロー式ＬＥＤ管を工事せずに使うのは大変危険です。火災事故につながるおそれがあります。絶対にやめてください。</font><br />
      </div></td>
    </tr>
